import { Route, Routes } from 'react-router-dom';
import './App.css';
import { Navbar } from './components/Navbar'
import { Login } from './components/pages/Login';
import { Home } from './components/pages/Home';
import { NavLink } from 'react-router-dom';
var framer_motion_1 = require("framer-motion");
var animations = {
  "AI": {
      "y": [
          null,
          -20
      ],
      "transition": {
          "y": {
              "type": "keyframes",
              "ease": [
                  0,
                  0,
                  0.58,
                  1
              ],
              "times": [
                  0,
                  1
              ],
              "duration": 0.9
          },
          "opacity": {
              "type": "keyframes",
              "ease": [
                  0,
                  0,
                  0.58,
                  1
              ],
              "times": [
                  0,
                  1
              ],
              "duration": 0.9
          }
      },
      "opacity": [
          0,
          1
      ]
  },
  "myButt": {
      "y": [
          null,
          -20
      ],
      "transition": {
          "y": {
              "type": "keyframes",
              "ease": [
                  0.25,
                  1,
                  0.5,
                  1
              ],
              "times": [
                  0,
                  1
              ],
              "duration": 0.9
          },
          "opacity": {
              "type": "keyframes",
              "ease": [
                  0.76,
                  0,
                  0.24,
                  1
              ],
              "times": [
                  0,
                  1
              ],
              "duration": 0.9
          }
      },
      "opacity": [
          0,
          1
      ]
  }
}
function App() {
  return (
    <div className="app align-middle items-center text-center justify-center">
      <Navbar />
      <div id="AI"className="grid grid-cols-1 align-middle p-20">
        <h1 className="text-center text-6xl p-5 justify-between">Personalized Fitness. </h1>
        <h1 className="text-center text-6xl justify-between">Built with Generative AI.</h1>  
      </div>
      <div id="myButt" className="px-8 mx-24">
        <Button />
      </div>
      <framer_motion_1.motion.div id="AI" animate={animations._8_95_personalized_fitness_built_with_generative_ai}/>
    <framer_motion_1.motion.div id="myButt" animate={animations._9_230_get_started_button}/>
    </div>
    
  )
}

const Button = () => {
  return (
    <button className="py-2 px-4 border rounded shadow-xl">
        <NavLink to="/login"><p>Get Started</p></NavLink>
    </button>
  )
} 

export default App;
